PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?node ?externalReference WHERE {
  ?node rdfs:seeAlso ?externalReference .
  FILTER(isIRI(?externalReference) && STRSTARTS(STR(?externalReference), "http"))
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rec: <https://w3id.org/rec#>

SELECT ?entity ?type WHERE {
